int n , ans , cnt=0;;
vector < int > v ;
vector < vector < int > > dp;


int rec(int mask , int prev){
    if(!mask) {
        return v[prev] ;
    }

    int &ret = dp[mask][prev];
    if(~ret)
        return ret ;
    ret =0;

    for(int i = 0 ; i < n ; i++){
        if((mask >> i) & 1 ){
            if(prev == n + 1) 
                ret =  max(ret , v[i] + rec( mask^(1<<i) , i ));
            else
                ret =  max(ret , abs(v[prev]-v[i])+ rec( mask^(1<<i) , i ));
        }
    }

    return ret ;
}


void build(int mask , int prev){
    if(!mask) {
        return ;
    }

    int ret = dp[mask][prev] , ret2=0;

    for(int i = 0 ; i < n ; i++){
        
        if((mask >> i) & 1 ){
            if(prev == n+1)  
                ret2 = v[i] ;
            else 
                ret2= abs(v[prev]-v[i]);
            
            ret2 += rec( mask^(1<<i) , i );

            if(ret2 == ret) cnt++ , build(  mask^(1<<i) , i);
        }
    }

    return  ;
}

