            [ProtoMember(7, IsRequired = true)]
            public uint TodayMarbles;
            [ProtoMember(8, IsRequired = true)]
            public uint Unknow8;
        }
        [ProtoContract]
        public class RankList
        {
            [ProtoMember(1)]
            public uint Rank;
            [ProtoMember(2)]
            public uint UID;
            [ProtoMember(3)]
            public uint MarblesCount;
            [ProtoMember(4)]
            public uint Mesh;
